import React from "react";
import cl from "./MySearch.module.css"

const MySearch=()=>{

    const PATH="M31.5,18.8c-3.7,0-6.8,3-6.8,6.8s3,6.8,6.8,6.8s6.8-3,6.8-6.8S35.2,18.8,31.5,18.8z M31.5,30.8   c-2.9,0-5.3-2.4-5.3-5.3s2.4-5.3,5.3-5.3s5.3,2.4,5.3,5.3S34.4,30.8,31.5,30.8z"
    return(
        <div className={cl.main}>
        <svg  className={cl.svg} viewBox="0 0 90 10">

        <path  d={PATH}/>
       
        </svg>
        
        <input className={cl.input}> 
        </input> 
        </div> 
    )
}


export default MySearch;
